/* eslint-disable max-len */
import { useSpring, animated } from 'react-spring';
import { useEffect, useState, useRef } from 'react';
import styled from 'styled-components';

function useInterval(callback: () => void, delay: number | null) {
	const savedCallback = useRef<() => void>();

	// Remember the latest function.
	useEffect(() => {
		savedCallback.current = callback;
	}, [callback]);

	// Set up the interval.
	useEffect(() => {
		function tick() {
            savedCallback.current!();
		}
		if (delay !== null) {
			const id = setInterval(tick, delay);
			return () => clearInterval(id);
		}
	}, [delay]);
}

function useAnimatedPath({ toggle, delay }: { toggle: boolean, delay: number }) {
	const [length, setLength] = useState<number | null>(null);
	const animatedStyle = useSpring({
		strokeDashoffset: toggle ? 0 : length!,
		strokeDasharray: length!,
		delay,
		config: {
			duration: 500
		}
	});

	const animatedFillStyle = useSpring({
		fill: toggle ? '#fff' : 'transparent',
		delay: 0,
		config: {
			duration: 150
		}
	});

	return {
		style: {
			...animatedStyle, ...animatedFillStyle
		},
		ref: (ref: SVGPathElement | null) => {
			if (ref) {
				setLength(ref.getTotalLength());
			}
		}
	};
}

function Path({ toggle, d }: { toggle: boolean, d: string }) {
	const animatedStrokeProps = useAnimatedPath({
		toggle,
		delay: 0
	});
	const animatedFillStyle = useSpring({
		delay: 0
	});

	return (
		<animated.path
			stroke={ '#fff' }
			strokeWidth={ '0.5%' }
			d={ d }
			{ ...animatedStrokeProps }
			style={ {
				...animatedStrokeProps.style, ...animatedFillStyle
			} }
		/>
	);
}

